import React from 'react';
import Login from './Login';
import { AppRoute } from './AppRoute'
import StatiquePage from './StatiquePage';
import Menu from './Menu'
import MenuParametrage from './MenuParametrage'
import MenuDocumentation from './MenuDocumentation'
import MenuDonneeBase from './MenuDonneeBase'

import { Link, BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Switch>
        <AppRoute path="/MenuDocumentation" component={MenuDocumentation} layout={StatiquePage}></AppRoute>
        <AppRoute path="/MenuParametrage" component={MenuParametrage} layout={StatiquePage}></AppRoute>
        <AppRoute path="/MenuDonneeBase" component={MenuDonneeBase} layout={StatiquePage}></AppRoute>
        <AppRoute path="/MenuAnalyse" component={MenuAnalyse} layout={StatiquePage}></AppRoute>
        <AppRoute path="/AjoutUser" component={AjoutUser} layout={StatiquePage}></AppRoute>
        <AppRoute path="/Menu" component={Menu} layout={StatiquePage}></AppRoute>
        <Route path="/" render={() => <Login />} />
      </Switch>
    </Router>
  );
}

export default App;
